package com.net.mokey.bean;

import java.io.Serializable;

public class AppInfo implements Serializable {

	
	public String C_JARNAME;
	public String C_TYPE;
	public String C_LOGOURL;
	public String SA;
	public String C_PUBLISH_DATE;
	public String C_NAME;
	public String C_APPURL;
	public String C_SIZE;
	public String C_ID;
	public String C_MANU;
	public String C_ABSTRACT;
	public String C_VERSION;
	
	public AppInfo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public AppInfo(String c_JARNAME, String c_TYPE, String c_LOGOURL,
			String sA, String c_PUBLISH_DATE, String c_NAME, String c_APPURL,
			String c_SIZE, String c_ID, String c_MANU, String c_ABSTRACT,
			String c_VERSION) {
		super();
		C_JARNAME = c_JARNAME;
		C_TYPE = c_TYPE;
		C_LOGOURL = c_LOGOURL;
		SA = sA;
		C_PUBLISH_DATE = c_PUBLISH_DATE;
		C_NAME = c_NAME;
		C_APPURL = c_APPURL;
		C_SIZE = c_SIZE;
		C_ID = c_ID;
		C_MANU = c_MANU;
		C_ABSTRACT = c_ABSTRACT;
		C_VERSION = c_VERSION;
	}
	@Override
	public String toString() {
		return "AppInfo [C_JARNAME=" + C_JARNAME + ", C_TYPE=" + C_TYPE
				+ ", C_LOGOURL=" + C_LOGOURL + ", SA=" + SA
				+ ", C_PUBLISH_DATE=" + C_PUBLISH_DATE + ", C_NAME=" + C_NAME
				+ ", C_APPURL=" + C_APPURL + ", C_SIZE=" + C_SIZE + ", C_ID="
				+ C_ID + ", C_MANU=" + C_MANU + ", C_ABSTRACT=" + C_ABSTRACT
				+ ", C_VERSION=" + C_VERSION + "]";
	}
	
	

}
